import React, {useEffect, useState} from 'react';
import axios from 'axios'

export function Cart(){
    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const fetchData = async () => {
            try{
                const { data: response} = await axios.get('http://localhost:4000/cart');
                setData(response);
                console.log(data)
            } catch (error) {
                console.error(error)
            }
            setLoading(false);
        };
        fetchData();
    }, [])

    return (
        <>
        <h1>Cart</h1>
        </>
    )
}
